        <div className="card">
        <div className="card-text">
            <span className="letter">Name: {props.order.name}</span>
        </div>
      
        <div className="card-text">
        <span className="letter">Price: {props.order.price}$</span>
        </div>
    
      </div>
    )

}

export default Order;
